Full Throttle Saloon is an American reality television series airing on the truTV network. The series provides an inside look at the world's largest biker bar located in Sturgis, South Dakota. Owner Mike Ballard and a full cast of characters race against the clock to serve huge crowds at the Full Throttle Saloon, which is only open for 10 days a year in August during the annual Sturgis Motorcycle Rally. More than 300,000 people visit the Full Throttle during the annual event, where Ballard and his team are pressured to make a year's salary in a short time window, all while providing patrons an experience they will not forget. The series marks the first time cameras have been allowed to capture every minute.The Full Throttle is the world's largest biker bar housed on 30 acres of land, which Ballard purchased in 1999. The indoor/outdoor bar includes several large stages, a burn-out pit, a tattoo parlor, zip lines, a wrestling ring, restaurants, dozens of stores, hundreds of cabins for rent and parking for thousands of motorcycles. Famous performers at the Full Throttle include Billy Ray Cyrus, Bret Michaels and Ice-T. Only open for 10 days a year in August (during the Sturgis Motorcycle Rally), the Full Throttle can average 15,000 guests a night.

